#include <stdio.h>
#include <stdlib.h>

#define ROWS 512
#define COLS 512
#define DATASIZE ROWS*COLS

void
__attribute__ ((noinline))  
sobel(volatile unsigned char * indata, 
		volatile unsigned char * outdata) 
{
	unsigned int X=0, Y=1, Z;
	/*---------------------------------------------------
	  SOBEL ALGORITHM STARTS HERE
	  ---------------------------------------------------*/
	#pragma omp parallel for num_threads(2) private(Y)
loop2:for(Z=0; Z<((ROWS-2)*(COLS-2)); Z++) {  
//	for(Y=1; Y<(ROWS-1); Y++)  {
//loop2:for(X=1; X<(COLS-1); X++)  {
			long sumX = 0;
			long sumY = 0;
			int  SUM = 0;

			Y = (X == (COLS-2)) ? Y + 1 : Y;
			X = (X == (COLS-2)) ? 1 : X + 1;
			
			/* Convolution starts here */
		/* 3x3 GX Sobel mask.  Ref: www.cee.hw.ac.uk/hipr/html/sobel.html */
		//		GX[0*3+0] = -1; GX[0*3+1] = 0; GX[0*3+2] = 1;
		//		GX[1*3+0] = -2; GX[1*3+1] = 0; GX[1*3+2] = 2;
		//		GX[2*3+0] = -1; GX[2*3+1] = 0; GX[2*3+2] = 1;
			/*-------X GRADIENT APPROXIMATION------*/
			sumX = sumX - (int)(indata[512*(Y - 1)+X - 1]);
			sumX = sumX - (int)(indata[512*(Y - 1)+X    ] << 1);
			sumX = sumX - (int)(indata[512*(Y - 1)+X + 1]);
			sumX = sumX + (int)(indata[512*(Y + 1)+X - 1]);
			sumX = sumX + (int)(indata[512*(Y + 1)+X    ] << 1);
			sumX = sumX + (int)(indata[512*(Y + 1)+X + 1]);
			
		/* 3x3 GY sobel mask.  ref: www.cee.hw.ac.uk/hipr/html/sobel.html */
		//		GY[0*3+0] =  1; GY[0*3+1] =  2; GY[0*3+2] =  1;
		//		GY[1*3+0] =  0; GY[1*3+1] =  0; GY[1*3+2] =  0;
		//		GY[2*3+0] = -1; GY[2*3+1] = -2; GY[2*3+2] = -1;
			/*-------Y GRADIENT APPROXIMATION------*/
			sumY = sumY + (int)( indata[512*(Y - 1)+X - 1]);
			sumY = sumY + (int)( indata[512*(Y    )+X - 1] << 1);
			sumY = sumY + (int)( indata[512*(Y + 1)+X - 1]);
			sumY = sumY - (int)( indata[512*(Y - 1)+X + 1]);
			sumY = sumY - (int)( indata[512*(Y    )+X + 1] << 1);
			sumY = sumY - (int)( indata[512*(Y + 1)+X + 1]);
			
			/*-------X GRADIENT BOUNDS------*/
			sumX = sumX > 255 ? 255 : sumX;
			sumX = sumX < 0 ? 0 : sumX;

			/*-------Y GRADIENT BOUNDS-------*/
			sumY = sumY > 255 ? 255 : sumY;
			sumY = sumY < 0 ? 0 : sumY;

			SUM = sumX + sumY; /*---GRADIENT MAGNITUDE APPROXIMATION (Myler p.218)----*/

//         printf("y=%d ; x=%d --> SUM = %d", Y,X,SUM);
			outdata[512*Y+X] = 255 - (unsigned char)(SUM);  /* make edges black and background white */
//         printf(" --> outdata[%d] = %d\n", X + Y*incols, outdata[X + Y*incols]);
//		}
	}
}

